$templateCache.put("modules/components/changeRuleNotice/changeRuleNotice.html","<section class=\"change-rule-notice\"><button type=\"button\" class=\"modal-close-btn\" ng-click=\"$ctrl.close()\"><span class=\"v-icons-x-big-empty\"></span></button><h2>4월 10일(월) Dooray! 개인정보처리방침 변경 안내</h2><p class=\"main-description\">Dooray를 이용해주시는 회원 여러분께 감사드리며, 개인정보처리방침 변경에 대한 안내 말씀 드립니다.<br>Dooray는 이용자 여러분의 개인정보를 무엇보다 소중하게 처리하고 있으며, 어떤 사안보다도 우선하여 안전하게 관리하고 있습니다.<br>새롭게 바뀐 개인정보처리방침의 변경사항을 확인하시고 서비스 이용에 참고하시기 바랍니다.</p><div class=\"change-detail\"><ol><li>1. 변경 사항&nbsp;<a href=\"/htmls/rules/20170330_privacy_policy.html\" target=\"_blank\">(개정 개인정보처리방침 전문 보기)</a><ul><li>‘개인정보처리방침 > 10. 개인정보보호책임자 및 담당자의 연락처’ 부분을 다음과 같이 변경하였습니다.<table><thead><tr><th>개정 전</th><th>개정 후</th></tr></thead><tbody><tr><td>- 개인정보 보호책임자<br>이름: 김현성, 소속/직위: 법무정책그룹/이사<br>이메일: privacy@payco.com<br>전화번호: 1544-6891<br><br>- 개인정보 보호담당자<br>이름: 백도민, 소속/직위: IT서비스본부/이사<br>이메일: privacy@payco.com<br>전화번호: 1544-6891<br></td><td>- 개인정보 보호책임자<br>이름: 김현성, 소속/직위: 법무정책그룹/이사<br><span class=\"color-blue\">이메일: privacy_ne@nhnent.com<br>전화번호: 1544-6859</span><br><br>- 개인정보 보호담당자<br>이름: 백도민, 소속/직위: IT서비스본부/이사<br><span class=\"color-blue\">이메일: privacy_ne@nhnent.com<br>전화번호: 1544-6859</span><br></td></tr></tbody></table></li></ul></li><li>2. 적용 시기<ul><li>변경된 개인정보처리방침은 2017년 4월 10일자로 효력이 발생됩니다.</li></ul></li><li>3. 문의 및 이의제기<ul><li>변경된 개인정보처리방침 내용에 대한 문의사항이 있으신 경우 두레이 고객센터로 접수해 주시면 신속하고 친절하게 안내해드리겠습니다.</li></ul></li><li>4. 두레이 고객센터 <a href=\"mailto:dooray@nhnent.com\">dooray@nhnent.com</a></li></ol></div><strong>Dooray는 앞으로도 회원님의 개인정보를 보다 안전하게 보호할 것을 약속 드리며, 신뢰받는 서비스로 보답하겠습니다.<br>감사합니다.</strong> <label class=\"checkbox-label\"><input type=\"checkbox\" ng-click=\"$ctrl.setNeverOpenedCookie()\"> <span class=\"v-icons-uncheck\"></span> 다시 보지 않기</label></section>");
